tables.table_schema:
CREATE TABLE ResearchInstitutions (
    institution_id INT,
    institution_name VARCHAR(255),
    location VARCHAR(255),
    PRIMARY KEY (institution_id)
);

CREATE TABLE research_institutions (
    id INT PRIMARY KEY,
    name TEXT,
    location TEXT
);

CREATE TABLE telemedicine_data (
    id INT PRIMARY KEY,
    patient_id INT,
    data TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE healthcare_advancements (
    id INT PRIMARY KEY,
    research_id INT,
    advancement_description TEXT,
    outcome TEXT
);

CREATE TABLE research_institutions (
	id INT PRIMARY KEY,
	name TEXT NOT NULL,
	location TEXT
);

CREATE TABLE healthcare_technology (
	id INT PRIMARY KEY,
	technology_name TEXT NOT NULL,
	manufacturer TEXT,
	year_of_release INT
);

CREATE TABLE treatment_protocols (
	id INT PRIMARY KEY,
	diagnosis TEXT NOT NULL,
	protocol_name TEXT,
	protocol_description TEXT
);

CREATE TABLE collaborations (
	id INT PRIMARY KEY,
	institution_id INT NOT NULL,
	technology_id INT NOT NULL
);
